class myColorOutComponent extends shapez.Component {
    static getId() {
        return "myColorOutComponent";
    }

    // setup required color data array from wire inputlines
    setupRequiredOutput( wpins ) {
        for (var i=0;i<this.outputLines;i++) {
            if (wpins.slots[i].linkedNetwork)
                if (wpins.slots[i].linkedNetwork.currentValue)
                    if (wpins.slots[i].linkedNetwork.currentValue._type=='color') {
                        var c = wpins.slots[i].linkedNetwork.currentValue.color;
                        this.reqout[i] = ( c=='uncolored' ? null : c );
                    }
                    else
                        this.reqout[i] = null;
                else
                    this.reqout[i] = null;
            else
                this.reqout[i] = null;
        }
    }

    tryToHandleInput( curitem ) {
        var j = 0;
        while (j<this.outputLines) {
            if ( (curitem.color === this.reqout[j]) & (this.outslot[j]===null) ) {
                this.outslot[j]=curitem;
                return true;
            }
            j++;
        }
        return false;
    }

    // check if all output ready
    checkIfOutputReady() {
        var len = 0;
        for (var k=0;k<this.outputLines;k++) {
            len += (this.outslot[k]!=null | this.reqout[k]===null ? 1 : 0);
        }
        return (len==this.outputLines);
    }

    constructor({ inputlines = 0, outputlines = 0 }) {
        super();
        this.inputLines = inputlines;
        this.outputLines = outputlines;
        this.reqout = [];
        this.outslot = [];
        for (var i=0; i<outputlines; i++) {
            this.reqout[i] = null;
            this.outslot[i] = null;
        }
    }
}

// the OutComponent for Mixing from RGB
class myColorMixOutComponent extends myColorOutComponent {
    static getId() {
        return "myColorMixOutComponent";
    }

    constructor({ inputlines = 0, outputlines = 0 }) {
        super( {inputlines,outputlines} );
        this.mixslot = [];
        for (var i=0; i<outputlines; i++) {
            this.mixslot[i] = { required:null,collected:[] };
        }
        this.mixelementof = {
            'red'   : ['yellow','purple','white'],
            'green' : ['yellow','cyan','white'],
            'blue'  : ['purple','cyan','white'],
        }
        this.mixable = ['yellow', 'purple', 'cyan', 'white'];
    }

    setupRequiredOutput( wpins ) {
        super.setupRequiredOutput( wpins );
        for (var i=0;i<this.outputLines;i++) {
            if (this.reqout[i]!=this.mixslot[i].required) {
                this.mixslot[i].required = null;
                this.mixslot[i].collected = [];
            }
        }
    }

    isMixable( color ) {
        return this.mixable.includes(color);
    }

    tryToHandleInput( curitem ) {
        if ( !super.tryToHandleInput( curitem ) ) {
            var j = 0;
            while (j<this.outputLines) {
                if ( this.isMixable(this.reqout[j]) & this.outslot[j]===null ) {
                    if ( this.tryToMix(j,curitem.color) ) return true
                }
                j++;
            }
            return false;
        }
        else
            return true;
    }

    tryToMix( slotindex, color ) {
        if (this.reqout[slotindex]==this.mixslot[slotindex].required) {
            if ( this.mixslot[slotindex].collected.includes(color) )
                return false;
            else {
                if (!this.isMixable(color))
                    if ( this.mixelementof[color].includes(this.mixslot[slotindex].required) ) {
                        this.mixslot[slotindex].collected.push(color);
                        if ( (this.mixslot[slotindex].collected.length==2 & this.mixslot[slotindex].required!='white') | (this.mixslot[slotindex].collected.length==3 & this.mixslot[slotindex].required=='white') ) {
                            this.mixslot[slotindex].required = null;
                            this.mixslot[slotindex].collected = [];
                            this.outslot[slotindex] = new shapez.ColorItem( this.reqout[slotindex] );
                            return true;
                        }
                    }
            }
        }
        else {
            if (!this.isMixable(color))
                if ( this.mixelementof[color].includes(this.reqout[slotindex]) ) {
                    this.mixslot[slotindex].required = this.reqout[slotindex];
                    this.mixslot[slotindex].collected.push(color);
                    return true;
                }
        }
        return false;
    }
}

class mySwitchComponent extends shapez.Component {
    static getId() {
        return "mySwitchComponent";
    }

    static getSchema() {
        return {
            color: shapez.types.string,
        };
    }

    clicked( shift=false ) {
        if (!shift) {
            switch (this.color) {
                case 'uncolored':
                    this.color = 'red';
                    break;
                case 'red':
                    this.color = 'green';
                    break;
                case 'green':
                    this.color = 'blue';
                    break;
                case 'blue':
                    this.color = 'uncolored';
                    break;
                default:
                    this.color = 'uncolored';
                    break;
            }
        }
        if (shift) {
            switch (this.color) {
                case 'purple':
                    this.color = 'yellow';
                    break;
                case 'yellow':
                    this.color = 'cyan';
                    break;
                case 'cyan':
                    this.color = 'white';
                    break;
                case 'white':
                    this.color = 'purple';
                    break;
                default:
                    this.color = 'white';
                    break;
            }
        }
    }

    getSelectedColor() {
        return this.color;
    }

    getSelectedColorSingleton() {
        return new shapez.ColorItem(this.color);
    }

    constructor({ color = 'uncolored' }) {
        super();
        this.color = color;
    }
}

class mySwitchSystem extends shapez.GameSystemWithFilter {
    constructor(root) {
        super(root, [mySwitchComponent]);

        this.spriteUncolored = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_uncolored.png");
        this.spriteRed = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_red.png");
        this.spriteGreen = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_green.png");
        this.spriteBlue = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_blue.png");
        this.spriteWhite = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_white.png");
        this.spritePurple = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_purple.png");
        this.spriteYellow = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_yellow.png");
        this.spriteCyan = shapez.Loader.getSprite("sprites/mySwitch/mySwitchComponent_cyan.png");
        this.sprites = [];
        this.sprites['uncolored'] = this.spriteUncolored;
        this.sprites['red'] = this.spriteRed;
        this.sprites['green'] = this.spriteGreen;
        this.sprites['blue'] = this.spriteBlue;
        this.sprites['white'] = this.spriteWhite;
        this.sprites['purple'] = this.spritePurple;
        this.sprites['yellow'] = this.spriteYellow;
        this.sprites['cyan'] = this.spriteCyan;
    }

    update() {
        for (let i = 0; i < this.allEntities.length; ++i) {
            const entity = this.allEntities[i];

            const mySWComp = entity.components.mySwitchComponent;
            const pinsComp = entity.components.WiredPins;

            pinsComp.slots[0].value = mySWComp.getSelectedColorSingleton();
        }
    }

    drawChunk(parameters, chunk) {
        const contents = chunk.containedEntitiesByLayer.regular;
        for (let i = 0; i < contents.length; ++i) {
            const entity = contents[i];
            const mySWComp = entity.components.mySwitchComponent;
            if (mySWComp) {
                const sprite = this.sprites[mySWComp.getSelectedColor()];
                entity.components.StaticMapEntity.drawSpriteOnBoundsClipped(parameters, sprite);
            }
        }
    }
}

class mySwitchOnClick extends shapez.BaseHUDPart {
    initialize() {
        this.root.camera.downPreHandler.add(this.downPreHandler, this);
    }

    downPreHandler(pos, button) {
        const tile = this.root.camera.screenToWorld(pos).toTileSpace();
        const contents = this.root.map.getLayerContentXY(tile.x, tile.y, "regular");
        if (contents) {
            const mySWComp = contents.components.mySwitchComponent;
            if (mySWComp) {
                if (button === shapez.enumMouseButton.left) {
                    mySWComp.clicked( false );
                    return shapez.STOP_PROPAGATION;
                }
                if (button === shapez.enumMouseButton.middle) {
                    mySWComp.clicked( true );
                    return shapez.STOP_PROPAGATION;
                }
            }
        }
    }
}

